// SPDX-License-Identifier: MIT
// Guild contract
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract Guild is ERC20 {
  struct Member {
    bool valid;
    uint8 grade;
    uint256 createdAt;
    uint256 chestETH;
    address addBy;
    address addressMember;
  }

  struct Invit {
    bool valid;
    address addr;
    string description;
  }

  struct Grade {
    bool valid;
    bool write;
    bool read;
    bool invit;
    bool desinvit;
    bool sendMoney;
    bool takeMoney;
    bool graduate;
    string name;
  }

  mapping(uint8 => Grade) _grades;
  mapping(uint256 => Member) _members;
  mapping(uint256 => Invit) _invits;
  uint256 id;
  uint256 nonceMember;
  uint256 countMember;
  uint256 countInvit;
  address payable owner;
  address myosAddress;

  constructor(
    string memory name,
    string memory symbol,
    address payable _owner,
    address _myosAddress,
    uint256 _id
  ) ERC20(name, symbol) {
    owner = _owner;
    myosAddress = _myosAddress;
    id = _id;
  }

  modifier onlyCreator() {
